$(document).ready(function(){var count=$(".onlineWidget .count");var panel=$(".onlineWidget .panel");var timeout;count.load("inc/who_is_online/online.php #online");$(".onlineWidget").hover(function(){clearTimeout(timeout);timeout=setTimeout(function(){panel.trigger("open")},500)},function(){clearTimeout(timeout);timeout=setTimeout(function(){panel.trigger("close")},500)});var loaded=false;var geodata;panel.bind("open",function(){panel.slideDown(function(){if(!loaded){panel.load("inc/who_is_online/geodata.php #geodata");loaded=true}})}).bind("close",function(){panel.slideUp()})});